tables.table_schema:
CREATE TABLE training_logs (
    log_id INT PRIMARY KEY,
    error_message TEXT,
    debug_info JSON,
    training_timestamp TIMESTAMP
);

CREATE TABLE error_logs (
    id INT PRIMARY KEY,
    error_message VARCHAR(255),
    timestamp TIMESTAMP,
    neural_network_id INT
);

CREATE TABLE debug_logs (
    id INT PRIMARY KEY,
    debug_info TEXT,
    timestamp TIMESTAMP,
    neural_network_id INT
);
